import { Link } from 'react-router-dom';

const UserPosts = () => {
    return (
        <div className="mt-10">
            <Link href="#" className="w-full h-80 grid grid-cols-12 items-center bg-white border border-gray-200 rounded shadow hover:bg-gray-100 dark:border-gray-700 dark:bg-gray-800 dark:hover:bg-gray-700">
                <div className="col-span-4 p-5 rounded w-full h-full">
                    <img className="w-full h-full rounded-xl" src="https://cdn.chotot.com/HWi9ov9nbW4rdkIJWEcNk4f0nodEgzZGZ7XlHUixTVE/preset:view/plain/727692ecc8b59ba2570c42e3a68dae80-2788900471891162108.jpg" alt="" />
                </div>
                <div className="col-span-8"></div>
            </Link>
        </div>

    );
};

export default UserPosts;
